import AddButton from './AddButton'
import RemoveButton from './RemoveButton'

const Conditional = () => {
    const [added, setadded] = useState(false)
    
    
  return (
    <div>
        {
           added?(
            <RemoveButton/>
           ):
           (
            <AddButton/>
           )
        }
    </div>
  )
}

export default Conditional
